	local s,e,m
	s,e = _KU_KFOE_Duct_getStartEndAndJump(AlignmentRefAndPos)
	m = getAlignmentInfo(AlignmentRefAndPos)
	return (math.atan2(e.Point.Y-s.Point.Y,e.Point.X-s.Point.X) - math.atan2(m.Tangent.Y,m.Tangent.X)) * (180/math.pi)
end

